#' `r if(debarcodeDirExists) { "## UMI Parsing {.tabset .tabset-fade .tabset-pills}" }`
#+ eval=debarcodeDirExists, echo=FALSE, fig.asp=0.2, fig.align="center", message=F, results="asis"

deb <- read.table(paste(debarcodeDir,"debarcode_stats.txt", sep="/"), fill=T)
inputReads <- as.numeric(as.character(deb$V3[1]))
validBcReads <- as.numeric(as.character(deb$V3[2]))
invalidBcReads <- inputReads-validBcReads

#create data frame
df <- data.frame(
  Metric = c("Input Reads", "Reads with Valid UMI", "% Reads with Valid UMI"),
  Value = c(inputReads, validBcReads, signif(validBcReads/inputReads, 3) * 100),
  stringsAsFactors = FALSE
)

#add popovers
df$`Value` <- cell_spec(
  prettyNum(df$Value, big.mark=",", scientific=FALSE),
  popover = spec_popover(
    content = c("The number of reads in the input FASTQ files",
                "The number of R1 reads with a valid UMI",
                "The percentage of input reads with a valid UMI"),
    title = NULL,
    position = "left"
  )
)

#write data frame
kable(df, escape = FALSE) %>% kable_styling(bootstrap_options = kableStyle)

#plotly
dfx <- data.frame(" "="barcode", "valid"=validBcReads, "invalid"=inputReads-validBcReads)
pl <- plot_ly(dfx, x = ~valid, y = ~" ", type = "bar", name="Valid", orientation = "h", hoverinfo = 'text', text = ~paste("Valid Reads: ", valid)) %>% 
	add_trace(x = ~invalid, name = "Invalid", hoverinfo = 'text', text = ~paste("Invalid Reads: ", invalid)) %>% 
	layout(barmode = 'stack', xaxis = list(title = "Reads"), yaxis = list(title = ""))

#create plot
pl


