#' `r if(alignmentDirExists) { "## Alignment {.tabset .tabset-fade .tabset-pills}" }`
#+ eval=alignmentDirExists, echo=FALSE, fig.asp=0.5, fig.align="center", message=F, results="asis"

#Using a subset of PICARD outputs
rt <- read.table(paste(alignmentDir, "rna_metrics.txt", sep="/"), nrows=1, header=T, fill=T)
starReport <- read.table(paste(alignmentDir, "Log.final.out", sep="/"), sep="|", fill=T)
starReport$V2 <- gsub("\t","",starReport$V2)

#parse out relevant stuff from STAR report
inputReads <- as.numeric(starReport$V2[grep("Number of input reads",starReport$V1)])
uniqueMapped <- as.numeric(starReport$V2[grep("Uniquely mapped reads number",starReport$V1)])
multiMapped <- as.numeric(starReport$V2[grep("Number of reads mapped to multiple loci",starReport$V1)])
tooManyMapped <- as.numeric(starReport$V2[grep("Number of reads mapped to too many loci",starReport$V1)])
unmapped <- inputReads-uniqueMapped-multiMapped

df <- data.frame("Reads Input" = inputReads,
                 "Uniquely Mapped Reads" = uniqueMapped,
                 "Multi-mapped Reads" = multiMapped,
                 "Reads mapped to too many loci" = tooManyMapped,
                 "Unmapped Reads" = unmapped,
                 "PF Bases" = rt$PF_BASES,
                 "PF Aligned Bases" = rt$PF_ALIGNED_BASES,
                 "Coding Bases" = rt$CODING_BASES,
                 "UTR Bases" = rt$UTR_BASES,
                 "Intronic Bases" = rt$INTRONIC_BASES,
                 "Intergenic Bases" = rt$INTERGENIC_BASES,
                 "Ribosomal Bases" = rt$RIBOSOMAL_BASES,
                 "Median CV Coverage" = rt$MEDIAN_CV_COVERAGE,
                 "Median 5' Bias" = rt$MEDIAN_5PRIME_BIAS,
                 "Median 3' Bias" = rt$MEDIAN_3PRIME_BIAS,
                 "Median 5' to 3' Bias" = rt$MEDIAN_5PRIME_TO_3PRIME_BIAS,
                 "% Stranded" = rt$PCT_CORRECT_STRAND_READS * 100,
		 "% rRNA bases" = (rt$RIBOSOMAL_BASES/rt$PF_BASES)*100,
                 check.names= F)
		
df <- as.data.frame(t(df)) %>% rownames_to_column()
names(df) <- c("Metric", "Value")

dfx <- data.frame(" "="Bases",
                  "Coding" = df$Value[which(df$Metric=="Coding Bases")],
                  "UTR" = df$Value[which(df$Metric=="UTR Bases")],
                  "Intronic" = df$Value[which(df$Metric=="Intronic Bases")],
                  "Intergenic" = df$Value[which(df$Metric=="Intergenic Bases")],
                  "Ribosomal" = df$Value[which(df$Metric=="Ribosomal Bases")], check.names=F)

pl <- plot_ly(dfx, x = ~`Coding`, y= ~" ", type = "bar", name="Coding", orientation = "h", hoverinfo = 'text', text = ~paste("Coding: ", dfx$`Coding`)) %>% 
  add_trace(x = ~`UTR`, name = "UTR", hoverinfo = 'text', text = ~paste("UTR: ", round(dfx$`UTR`))) %>%
  add_trace(x = ~`Intronic`, name = "Intronic", hoverinfo = 'text', text = ~paste("Intronic: ", round(dfx$`Intronic`))) %>%
  add_trace(x = ~`Intergenic`, name = "Intergenic", hoverinfo = 'text', text = ~paste("Intergenic: ", round(dfx$`Intergenic`))) %>%
  add_trace(x = ~`Ribosomal`, name = "Ribosomal", hoverinfo = 'text', text = ~paste("Ribosomal: ", round(dfx$`Ribosomal`))) %>%
  layout(barmode = 'stack', xaxis = list(title = "Aligned Bases"), yaxis = list(title = ""))

df$`Value` <- cell_spec(
  prettyNum(df$Value, big.mark=",", scientific=FALSE),
  popover = spec_popover(
    content = c("The number of reads input to alignment.",
                "The number of reads mapped to a unique genetic locus.",
                "The number of reads mapping to multiple genetic loci.",
                "The number of reads mapping to too many genetic loci for further processing (a subset of the value listed above).",
                "The number of reads that did not map to the reference genome.",
                "The total number of PF bases including non-aligned reads.",
                "The total number of aligned PF bases. Non-primary alignments are not counted. Bases in aligned reads that do not correspond to reference (e.g. soft clips, insertions) are not counted.",
                "Number of bases in primary alignments that align to a non-UTR coding base for some gene, and not ribosomal sequence.",
                "Number of bases in primary alignments that align to a UTR base for some gene, and not a coding base.",
                "Number of bases in primary alignments that align to an intronic base for some gene, and not a coding or UTR base.",
                "Number of bases in primary alignments that do not align to any gene.",
                "Number of bases in primary alignments that align to ribosomal sequence.",
                "The median coefficient of variation (CV) or stdev/mean for coverage values of the 1000 most highly expressed transcripts. Ideal value = 0.",
                "The median 5 prime bias of the 1000 most highly expressed transcripts. The 5 prime bias is calculated per transcript as: mean coverage of the 5 prime-most 100 bases divided by the mean coverage of the whole transcript.",
                "The median 3 prime bias of the 1000 most highly expressed transcripts, where 3 prime bias is calculated per transcript as: mean coverage of the 3 prime-most 100 bases divided by the mean coverage of the whole transcript.",
                "The ratio of coverage at the 5 prime end to the 3 prime end based on the 1000 most highly expressed transcripts.",
                "The Percentage of reads corresponding to transcripts which map to the correct strand of a reference genome "),
    
    title = NULL,
    position = "left"
  )
)  

#create table
df$Value <- prettyNum(df$Value, big.mark = ",", scientific=FALSE)
kable(df, escape = FALSE) %>% kable_styling(bootstrap_options = kableStyle)

